text:
Our hearts are broken over the great loss of Americans to COVID-19. Our prayers are with their families.

@SpeakerPelosi &amp; I made the request of Pres. Trump to lower flags to half staff to honor those lost

It will serve as a national expression of grief so needed in our country https://t.co/kxFco5Q6o0

To President Trump:

@SpeakerPelosi &amp; I are writing to request that you order flags to be flown at half staff on all public buildings on the sad day of reckoning when we reach 100,000 deaths.

It would serve as a national expression of grief so needed by everyone in our country. https://t.co/4zH1s8JtAL
